import './App.css';
import Button from 'react-bootstrap/Button';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <div className="App">
      <Container className='game-container'>
        <Row>
          <Col xs={10} md={8} className='justify-content-center'>
            <Card>
              <Card.Body>
                <div className='article-text'><text>DIE </text>Word</div>
                <Form id='find-article-form'>
                  <Form.Control className='article-input' type="email" placeholder="Enter a word" />
                  <Row className='flex-row-reverse'>
                    <Col xs={12} md={5}>
                    <Button className='margin-top-sm float-right'>Find the article</Button>
                    </Col>
                  </Row>
                </Form>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>

    </div>
  );
}

export default App;
